import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import Demographic from './Demographic';

function App() {
  return (
    <Router>
      <Route exact path="/">
        <Redirect to="/demographic" />
      </Route>
      <Route path="/demographic" component={Demographic} />
    </Router>
  );
}

export default App;
